import axios from "axios";

const api = axios.create({
    baseURL: 'https://localhost:3000/riotapi'
})

export const loadLolacc = payload => api.get('/lolacc', payload)
export const loadRankedstats = payload => api.get('/rankedstats', payload)

const apis = {
    loadLolacc,
    loadRankedstats,
}
